import React, { Component } from 'react';
import { Table } from 'antd';

class TableJobs extends Component {

  render() {
    const { data } = this.props

    const columns = [
      {
        title: 'Job Title',
        dataIndex: 'title',
        render: (text, record) => (
          <h2 className="table-avatar">
            <a href="/admin/profile" className="avatar avatar-sm mr-2"><img alt="" src={`http://excodeteam.com/crs/public/images/${record.image}`} /></a>
            <a href="/admin/profile">{text}</a>
          </h2>
        ),
      },
      {
        title: 'Employer',
        dataIndex: 'employer',
        render: ({ name, photo }) => (
          <h2 className="table-avatar">
            <a href="/admin/profile" className="avatar avatar-sm mr-2"><img alt="" src={`http://excodeteam.com/crs/public/images/${photo}`} /></a>
            <a href="/admin/profile">{name}</a>
          </h2>
        ),
      },
    ]

    return (
      <div>
        <Table className="table-striped"
          style={{ overflowX: 'auto' }}
          columns={columns}
          // bordered
          dataSource={data}
          rowKey={record => record.id}
          pagination={false}
        />
      </div>

    )
  }
};

export default TableJobs;
